<B>             Interpretatio quam in Iuliam retorsit.
</B>
     Ez szeles vilagon mennj uirag uagion mindaz sem &eacute;r egi rosat
        Az olli vendegsegis kiben egi kegies szint mind az sem &eacute;r egi bapkat
                Enis minden sz&ucirc;zn&eacute;l ki ez vilagon &eacute;l feleb Tartom Iuliat.
